import React from 'react';
import '../../../Screens/HomeScreen.css'
import MenSocks from './MenSocks';
import MenSocksData from './MenSocksData';

export default function MenSocksScreen() {
    return (
        <div>
            <div className="row center">
  {MenSocksData.Shocks.map((product)=>
   <MenSocks key = {product._id} product ={product}></MenSocks>
  )
  }
 </div>
        </div>
    )
}
